import { useEffect, useState } from "react";
import "./style.css";

function Nav() {
  return (
    <div>
      <nav className="menu">
        <p>네비박스</p>
      </nav>
    </div>
  );
}

function Content() {
  return (
    <div>
      <div className="contants">
        <p>컨텐츠박스</p>
      </div>
    </div>
  );
}

// url = "https://dapi.kakao.com/v2/search/image"
